import React ,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faGlobeAfrica } from '@fortawesome/free-solid-svg-icons'
class BlockNav extends Component{
	
  render(){
	  
	
    return(
    <div className="container">
   
	 <div className="row">
	 <div className="row">navigation</div>
	  <div className="row"><FontAwesomeIcon icon={faGlobeAfrica} style={{fontSize:'200%'}}/>dashboard</div> <div className="row"><FontAwesomeIcon icon={faGlobeAfrica} style={{float:'right',fontSize:'200%'}}/>candidates</div>
	</div>
    </div>
    );
}
}
export default BlockNav;
